selector_to_html = {"a[href=\"#test-to-make-sure-there-is-only-an-active-status\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Test to Make Sure There is only an \u201cActive\u201d Status<a class=\"headerlink\" href=\"#test-to-make-sure-there-is-only-an-active-status\" title=\"Link to this heading\">#</a></h2><p>Need to go through the entire first page of results after click the Status bar, to make sure there are no other status\u2019s that exist in the Status column.</p><p><strong>Important Items to Note:</strong></p>", "a[href=\"#fill-out-legal-information\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">3. Fill out Legal Information<a class=\"headerlink\" href=\"#fill-out-legal-information\" title=\"Link to this heading\">#</a></h3><p>First the fields for all the legal information is checked:</p>", "a[href=\"#first-page-sponsor-organization-information\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">First Page: Sponsor Organization Information<a class=\"headerlink\" href=\"#first-page-sponsor-organization-information\" title=\"Link to this heading\">#</a></h4><p>This page contains most of the information that needs to be filled out.</p>", "a[href=\"#finish-table\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">5. Finish Table<a class=\"headerlink\" href=\"#finish-table\" title=\"Link to this heading\">#</a></h3><p>This should just check that the fields exist and click, <code class=\"docutils literal notranslate\"><span class=\"pre\">Done</span></code></p>", "a[href=\"#checking-that-the-active-status-is-the-only-one-that-exists-under-the-status-column-when-active-status-is-selected\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Checking that the  <code class=\"docutils literal notranslate\"><span class=\"pre\">Active</span></code> Status is the only one that exists under the \u201cStatus\u201d column when \u201cActive\u201d Status is selected.<a class=\"headerlink\" href=\"#checking-that-the-active-status-is-the-only-one-that-exists-under-the-status-column-when-active-status-is-selected\" title=\"Link to this heading\">#</a></h3><p>This is where it might get a little tricky, the current <code class=\"docutils literal notranslate\"><span class=\"pre\">Active</span></code> status in the Status column doesn\u2019t have a locator that is represented by get-by-role or get_by_text, instead it\u2019s positional, and I believe this is what is just the order the status appears in the Status dropdown list, the <code class=\"docutils literal notranslate\"><span class=\"pre\">Active</span></code> status looks like this in the UI:</p><p>![[Pasted image 20250129103158.png]]</p>", "a[href=\"#second-page-users-page\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Second Page: Users page<a class=\"headerlink\" href=\"#second-page-users-page\" title=\"Link to this heading\">#</a></h4><p>This page contains a way to add new users to the Sponsorship Organizations.</p>", "a[href=\"#sponsor-organizations\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Sponsor Organizations<a class=\"headerlink\" href=\"#sponsor-organizations\" title=\"Link to this heading\">#</a></h1><h2>Test to Make Sure There is only an \u201cActive\u201d Status<a class=\"headerlink\" href=\"#test-to-make-sure-there-is-only-an-active-status\" title=\"Link to this heading\">#</a></h2><p>Need to go through the entire first page of results after click the Status bar, to make sure there are no other status\u2019s that exist in the Status column.</p><p><strong>Important Items to Note:</strong></p>", "a[href=\"#creating-a-new-sponsor-organization\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Creating a New Sponsor Organization<a class=\"headerlink\" href=\"#creating-a-new-sponsor-organization\" title=\"Link to this heading\">#</a></h2><p>This test will just test to make sure the \u201cCreate a New Sponsor Organization\u201d is properly working. It also involves going to the Sponsor Organizations tab, but it also involves performing each of these tests for each tab inside of the Sponsor Organizations tab:</p>", "a[href=\"#fill-out-the-cit-corporation-information-for-a-new-cit-corporation-to-add\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">2. Fill out the CIT Corporation Information for a new CIT Corporation to add.<a class=\"headerlink\" href=\"#fill-out-the-cit-corporation-information-for-a-new-cit-corporation-to-add\" title=\"Link to this heading\">#</a></h3><p>We will go through this tab, check each field, fill out the info, and select both the \u201cRequire Investor to Upload Proof of Address\u201d and the \u201cDoes the Proof of Address document need to be approved before allowing the investor to invest?\u201d</p><p>2.1 Check the fields:</p>", "a[href=\"#third-page-finish-page\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Third Page: Finish Page<a class=\"headerlink\" href=\"#third-page-finish-page\" title=\"Link to this heading\">#</a></h4><p>This page has a success message that we need to check for.</p><p>There is also an \u201cAdd CIT Corporation to this Sponsor Organization\u201d button.</p>", "a[href=\"#users-tab\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">4. Users Tab<a class=\"headerlink\" href=\"#users-tab\" title=\"Link to this heading\">#</a></h3><p>This tab looks a lot like the Users tab from before.  This might need to be reused.</p><p>But getting there might be a little different, and fields should be checked.</p>", "a[href=\"#checking-for-the-fields-on-each-page\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Checking for the fields on each page<a class=\"headerlink\" href=\"#checking-for-the-fields-on-each-page\" title=\"Link to this heading\">#</a></h3><p>There is a workflow that appears when you got to create a new sponsor organization, it has three pages:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
